import React from 'react';
import { ReactComponent as Logo } from '../logo.svg';
import { ReactComponent as Circles } from '../circles.svg';
import {UserAddIcon} from '@heroicons/react/solid'

class Navigation extends React.Component {
   render() { 
      return <header className='border-b border-gray-300 py-4'>
         <div className='container mx-auto flex items-center justify-between relative'>
         <Circles className='absolute  right-full -top-4 mr-12'/>
         <a href='/'>
            <Logo/>
         </a>
         <nav>
            <ul className='flex'>
               <li>
                  <a href="/signup" className='py-2 md:px-4 md:py-3 
                  rounded-xl active md:text-lg text-white
                  bg-gradient-to-r from-purple-500 to-indigo-700 
                  hover:from-green-500 md:inline-flex hover:to-blue-700 transition'>
                  <UserAddIcon className="md:mr-4 h-6 w-6 text-white-500"/>
                  Free Signup
                  </a>
               </li>
            </ul>
         </nav>
         </div>

      </header>;   
      }
}

export default Navigation;
